import "./HomePage.css";
import { Link } from "react-router-dom";

function HomePage() {
  return (
    <>
      <div>
        <h1>
          <span id="first-row">빙고로 알아보는</span>
          <br />
          <span>나의</span>
          <span>진짜</span>
          <span>MBTI!</span>
        </h1>
        <div></div>
        <div>
          <Link to={"/profile"} className="btn">
            시작하기
          </Link>
        </div>
      </div>
    </>
  );
}

export default HomePage;
